import { initializeApp } from "firebase/app";
import { getAuth, signOut, } from "firebase/auth";
import { useNavigate } from "react-router-dom";
import "./app.css"
function Main() {


    const [data, setData] = useState([])
    const [value,setValue]=useState("")
const navigate = useNavigate()

    const firebaseConfig = {
        apiKey: "AIzaSyClEH1wG_p4Bk7y8dl88UEi1OcSmd_7Yl4",
        authDomain: "pro-app-7adb5.firebaseapp.com",
        projectId: "pro-app-7adb5",
        storageBucket: "pro-app-7adb5.appspot.com",
        messagingSenderId: "840528707586",
        appId: "1:840528707586:web:759e54f6d5ecf02251671b",
        measurementId: "G-Q000JTLWD8"
    };

    
    const app = initializeApp(firebaseConfig);
    const auth = getAuth()
    const submitData = (event) => {
        event.preventDefault()




        signOut(auth)
            .then(() => {
                alert("Logout successfull")
                navigate("/Login")
            })
            .catch(() => {
                alert("error")
            })




            fetch(" http://localhost:3002/E-commerce")
            .then((res) => {
                return res.json()
            })
            .then((resp) => {
                setData(resp)
            }, [])
    
    
       
         const search=async (a)=>{
            a.preventDefault()
            return await axios.get("http://localhost:3002/E-commerce?q=${value}")
            .then((res)=>{
                setData(res.data)
            })
            .catch((err)=>{
                console.log(err)
            })
         }
    


    }

    return (


        <div >




            <div class="nav">
                <div class="item"><img src="https://cdn-icons-png.flaticon.com/512/146/146940.png" style={{ width: "70px", borderRadius: "20%" }}></img></div>
                <div class="item"><b>BOOK STALL</b></div>
                <div class="item"> <form class="d-flex" role="search">
                    <input class="form-control me-2" type="search" placeholder="Search" aria-label="Search" style={{ width: "500px" }} />
                    <button class="btn btn-outline-success" type="submit">Search</button>
                </form></div>
                <div class="item"><i class="fa-solid fa-bell fa-shake" style={{ border: "1px solid black ", borderRadius: "50%", padding: "10px" }}></i></div>
                <div class="item"> <form id="log" onSubmit={submitData}>
                    <button type="submit" class="btn btn-danger">Logout</button>
                </form></div>
            </div>


            <div id="con" style={{ display: "flex", gap: "20px" }}>
                <div class="con1">
                    <form onSubmit={submitData} style={{ backgroundColor: "light white", width: "330px", padding: "10px", marginTop: "40px" }}>


                        <div className="mb-3" style={{ width: "300px" }}>
                            <select id="disabledSelect" class="form-select">
                                <option >shop by consern</option>
                            </select>
                        </div>

                        <div className="mb-3" style={{ width: "300px" }}>
                            <select id="disabledSelect" class="form-select">
                                <option>Shop by category</option>
                            </select>
                        </div>

                        <div className="mb-3" style={{ width: "300px" }}>
                            <select id="disabledSelect" class="form-select">
                                <option>Shop by product</option>
                            </select>
                        </div>

                        <div className="mb-3" style={{ width: "300px" }}>
                            <select id="disabledSelect" class="form-select">
                                <option>Shop by all</option>
                            </select>
                        </div>


                    </form>
                    <div className="mb-3" style={{ width: "300px" }}>
                        <select id="disabledSelect" class="form-select">
                            <option>sort</option>
                            <option>Name</option>
                            <option>Art by</option>
                            <option>Price </option>
                        </select>
                    </div>
                </div>

            </div>


            <div style={{ display: "grid", gridTemplateColumns: "auto auto auto", gridGap: "20px", marginTop: "10px" }}>
                {data.map((ourdata) => (
                    <div>
                        <div className="card" style={{ width: "250px", height: "330px", textAlign: "center" }} >
                            <img src={ourdata.img} style={{ width: "220px", height: "200px", borderRadius: "8px", marginLeft: "14px", marginTop: "20px" }} />
                            <h3>{ourdata.name}</h3>
                            <h5>{ourdata.manufacturer}</h5>
                            <h5> ${ourdata.price}</h5>
                            <p className="btn btn-success">ADD CART</p>
                        </div>
                    </div>
                ))}
            </div>




        </div>







































    )
}
export default Main;
